import React from 'react';
import Logo from './Logo/Logo';
import { NavLink } from 'react-router-dom';
import User from '../../../assets/miclaude.png';
import { Navbar, Nav, Image } from 'react-bootstrap';
import { FiLogOut } from "react-icons/fi";
import { RiShoppingBasketLine } from "react-icons/ri";

import './Toolbar.css';

const Toolbar = () => {
    return (
        <Navbar collapseOnSelect expand="sm" className="Toolbar" variant="dark" style={{padding:'0'}}>
            <Navbar.Brand style={{padding:'0'}}><Logo/></Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="mr-auto"/>
                <Nav style={{paddingRight:'10px'}}>
                    <NavLink to="/logout" className='NavLogout'> <RiShoppingBasketLine className="Icons"/></NavLink>
                    <NavLink to="/profil" className='NavUser'><Image src={User} className='User' roundedCircle/></NavLink>
                    <NavLink to="/logout" className='NavIcons'><FiLogOut className="Icons"/></NavLink>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}

export default Toolbar;
